(688, 1, 'ar', 'name', 'تفاح', '2021-09-11 10:26:23', '2021-09-11 10:26:23', 'Product'),
(689, 1, 'ar', 'description', 'يرغب العديد من البستانيين في زراعة التفاح ، ولكن قد يكون من الصعب نموهم جيدًا لأن أشجار التفاح معرضة للعديد من مشاكل الحشرات والأمراض. على الرغم من أن الأصناف الجديدة قد تم تربيتها لتكون شديدة التحمل ، إلا أنها لا تزال تتطلب بعض طرق الرش أو التغطية أو طرق الحماية الأخرى. تحتاج أشجار التفاح أيضًا إلى قدر كبير من التقليم. عند التقليم ، ركز على ترقق الفروع لزيادة كمية ضوء الشمس وتدفق الهواء الذي يمكن أن يضرب جميع أجزاء الشجرة. هذا يعزز النمو الصحي ويساعد على الوقاية من الأمراض.', '2021-09-11 10:26:23', '2021-09-15 05:42:04', 'Product'),
