(692, 1, 'sp', 'name', 'manzana', '2021-09-11 10:26:23', '2021-09-11 10:26:23', 'Product'),
(693, 1, 'sp', 'description', 'Muchos jardineros quieren cultivar manzanas, pero pueden ser dif&iacute;ciles de cultivar bien porque los manzanos son propensos a muchos problemas de insectos y enfermedades. Aunque los nuevos cultivares se crearon para que fueran resistentes, todav&iacute;a requieren algunos m&eacute;todos de fumigaci&oacute;n, cobertura u otros m&eacute;todos de protecci&oacute;n. Los manzanos tambi&eacute;n necesitan una gran poda. Al podar, conc&eacute;ntrese en adelgazar las ramas para aumentar la cantidad de luz solar y el flujo de aire que puede llegar a todas las partes del &aacute;rbol. Esto promueve un crecimiento saludable y ayuda a prevenir enfermedades.', '2021-09-11 10:26:23', '2021-09-15 05:42:04', 'Product'),
(694, 1, 'sp', 'meta_keyword', '#manzana', '2021-09-11 10:26:23', '2021-09-15 05:42:04', 'Product'),
