(736, 5, 'ar', 'name', 'سلمون ألاسكا البري', '2021-09-11 11:33:35', '2021-09-11 11:33:35', 'Product'),
(737, 5, 'ar', 'description', '<p>أصلية كما تحصل! تذوق طعم مياه المحيط الأطلسي مع شرائح السلمون الأطلسية المعتمدة من Topchop mom. احصل على التذكرة النهائية للرفاهية لأنها تقدم لك نكهتها الزيتية الغنية والرقيقة المميزة مع كل قضمة. مغذي ولذيذ ، لن يكون هناك لقمة لن تستمتع بها.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>* الصور المستخدمة في الموقع لأغراض مرجعية وليست الصورة الفعلية.</p>', '2021-09-11 11:33:35', '2021-09-11 11:33:35', 'Product'),
(738, 5, 'ar', 'meta_keyword', 'سلمون ألاسكا البري', '2021-09-11 11:33:35', '2021-09-11 11:33:35', 'Product'),
(739, 5, 'ar', 'colorname', 'red', '2021-09-11 11:33:35', '2021-09-11 11:33:35', 'Product'),
(740, 5, 'sp', 'name', 'Salmón salvaje de Alaska', '2021-09-11 11:33:35', '2021-09-11 11:33:35', 'Product'),
(741, 5, 'sp', 'description', '<p>&iexcl;Tan aut&eacute;ntico como parece! Pruebe las aguas del Atl&aacute;ntico con los filetes de salm&oacute;n del Atl&aacute;ntico certificados de Topchop mom. Obtenga el boleto definitivo al lujo, ya que le ofrecen su caracter&iacute;stico sabor graso rico y delicado con cada bocado. Nutritivo y delicioso, no habr&aacute; un bocado que no le guste.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>* Las im&aacute;genes utilizadas en el sitio son para fines referenciales y no la fotograf&iacute;a real.</p>', '2021-09-11 11:33:35', '2021-09-11 11:33:35', 'Product'),
(742, 5, 'sp', 'meta_keyword', 'Salmón salvaje de Alaska', '2021-09-11 11:33:35', '2021-09-11 11:33:35', 'Product'),
