(750, 6, 'en', 'name', 'King Chinook', '2021-09-13 11:46:10', '2021-09-13 11:46:10', 'Product'),
(751, 6, 'en', 'description', '<p>Chinook have&nbsp;<strong>a dark greenish to deep blue back and a silvery white belly</strong>. They have distinct spots along the back and tail, and a black gum line, giving it the nickname &ldquo;black mouth&rdquo; salmon. Its fillets can range from red to snowy white, which are often marketed as &ldquo;winter&rdquo; or &ldquo;ivory&rdquo; Chinooks.</p>', '2021-09-13 11:46:10', '2021-09-13 11:46:10', 'Product'),
(752, 6, 'en', 'meta_keyword', 'King Chinook', '2021-09-13 11:46:10', '2021-09-13 11:46:10', 'Product'),
(753, 6, 'en', 'colorname', 'white', '2021-09-13 11:46:10', '2021-09-13 11:46:10', 'Product'),
(754, 6, 'ar', 'name', 'الملك شينوك', '2021-09-13 11:46:10', '2021-09-13 11:46:10', 'Product'),
(755, 6, 'ar', 'description', '<p>طراز شينوكله ظهر أخضر داكن إلى أزرق غامق وبطن أبيض فضي. لديهم بقع مميزة على طول الظهر والذيل ، وخط اللثة السوداء ، مما يطلق عليه اسم السلمون &quot;الفم الأسود&quot;. يمكن أن تتراوح الشرائح من الأحمر إلى الأبيض الثلجي ، والتي غالبًا ما يتم تسويقها على أنها شينوك &quot;الشتوية&quot; أو &quot;العاجية&quot;.</p>', '2021-09-13 11:46:10', '2021-09-13 11:46:10', 'Product'),
(756, 6, 'ar', 'meta_keyword', 'الملك شينوك', '2021-09-13 11:46:10', '2021-09-13 11:46:10', 'Product'),
(757, 6, 'ar', 'colorname', 'أبيض', '2021-09-13 11:46:10', '2021-09-13 11:46:10', 'Product'),
(758, 6, 'sp', 'name', 'Rey Chinook', '2021-09-13 11:46:10', '2021-09-13 11:46:10', 'Product'),
(759, 6, 'sp', 'description', '<p>El chinook tiene un dorso de color verdoso oscuro a azul profundo y un vientre blanco plateado. Tienen manchas distintas a lo largo de la espalda y la cola, y una l&iacute;nea de enc&iacute;a negra, lo que le da el sobrenombre de salm&oacute;n de &quot;boca negra&quot;. Sus filetes pueden variar de rojo a blanco como la nieve, que a menudo se comercializan como Chinooks de &ldquo;invierno&rdquo; o &ldquo;marfil&rdquo;.</p>', '2021-09-13 11:46:10', '2021-09-13 11:46:10', 'Product'),
(760, 6, 'sp', 'meta_keyword', 'Rey Chinook', '2021-09-13 11:46:10', '2021-09-13 11:46:10', 'Product'),
(761, 6, 'sp', 'colorname', 'blanca', '2021-09-13 11:46:10', '2021-09-13 11:46:10', 'Product'),
(762, 7, 'en', 'name', 'Sockeye Red', '2021-09-13 12:24:17', '2021-09-13 12:24:17', 'Product'),
(763, 7, 'en', 'description', '<p>&nbsp;</p>\r\n\r\n<p>Unique among salmon, sockeye&nbsp;prefers watersheds with lakes and spends up to three years living in lakes before heading downstream to the ocean. ... These fish are known as kokanee salmon or &quot;silver trout,&quot; and are much smaller than other sockeyes.</p>', '2021-09-13 12:24:17', '2021-09-13 12:24:17', 'Product'),
(764, 7, 'en', 'meta_keyword', 'Sockeye Red', '2021-09-13 12:24:17', '2021-09-13 12:24:17', 'Product'),
(765, 7, 'en', 'colorname', 'Red', '2021-09-13 12:24:17', '2021-09-13 12:24:17', 'Product'),
(766, 7, 'ar', 'name', 'سوكي أحمر', '2021-09-13 12:24:17', '2021-09-13 12:24:17', 'Product'),
(767, 7, 'ar', 'description', '<p>فريد من نوعه بين سمك السلمون ، يفضل السلمون الأحمر&nbsp;مستجمعات المياه مع البحيرات ويقضي ما يصل إلى ثلاث سنوات في البحيرات قبل التوجه إلى المحيط. ... تُعرف هذه الأسماك باسم السلمون kokanee أو &quot;التراوت الفضي&quot; ، وهي أصغر بكثير من أنواع السوكي الأخرى.</p>', '2021-09-13 12:24:17', '2021-09-13 12:24:17', 'Product'),
(768, 7, 'ar', 'meta_keyword', 'سوكي أحمر', '2021-09-13 12:24:17', '2021-09-13 12:24:17', 'Product'),
(769, 7, 'ar', 'colorname', 'أحمر', '2021-09-13 12:24:17', '2021-09-13 12:24:17', 'Product'),
(770, 7, 'sp', 'name', 'Rojo Sockeye', '2021-09-13 12:24:17', '2021-09-13 12:24:17', 'Product'),
(771, 7, 'sp', 'description', '<p>&Uacute;nico entre el salm&oacute;n, el salm&oacute;n rojo prefiere las cuencas con lagos y pasa hasta tres a&ntilde;os viviendo en los lagos antes de dirigirse r&iacute;o abajo hacia el oc&eacute;ano. ... Estos peces se conocen como salm&oacute;n kokanee o &quot;trucha plateada&quot; y son mucho m&aacute;s peque&ntilde;os que otros salmones rojos.</p>', '2021-09-13 12:24:17', '2021-09-13 12:24:17', 'Product'),
(772, 7, 'sp', 'meta_keyword', 'Rojo Sockeye', '2021-09-13 12:24:17', '2021-09-13 12:24:17', 'Product'),
(773, 7, 'sp', 'colorname', 'roja', '2021-09-13 12:24:17', '2021-09-13 12:24:17', 'Product'),
(774, 8, 'en', 'name', 'Coho Silver', '2021-09-13 12:50:59', '2021-09-13 12:50:59', 'Product'),
(775, 8, 'en', 'description', '<p>Commonly called silver salmon, coho have&nbsp;dark metallic blue or greenish backs with silver sides and a light belly. While they are in the ocean, they have small black spots on their back and on the upper lobe of the tail. The gumline in the lower jaw has lighter pigment than on Chinook salmon.</p>', '2021-09-13 12:50:59', '2021-09-13 12:50:59', 'Product'),
(776, 8, 'en', 'meta_keyword', 'Coho Silver', '2021-09-13 12:50:59', '2021-09-13 12:50:59', 'Product'),
(777, 8, 'en', 'colorname', 'Silver', '2021-09-13 12:50:59', '2021-09-13 12:50:59', 'Product'),
(778, 8, 'ar', 'name', 'كوهو سيلفر', '2021-09-13 12:50:59', '2021-09-13 12:50:59', 'Product'),
(779, 8, 'ar', 'description', '<p>يُعرف باسم السلمون الفضي ، وله ظهر باللون الأزرق المعدني الداكن أو المخضر مع جوانب فضية وبطن فاتح. أثناء وجودهم في المحيط ، لديهم بقع سوداء صغيرة على ظهورهم وعلى الفص العلوي من الذيل. يحتوي خط اللثة في الفك السفلي على صبغة أفتح من لون سمك السلمون من طراز تشينوك.</p>', '2021-09-13 12:50:59', '2021-09-13 12:50:59', 'Product'),
(780, 8, 'ar', 'meta_keyword', 'كوهو سيلفر', '2021-09-13 12:50:59', '2021-09-13 12:50:59', 'Product'),
(781, 8, 'ar', 'colorname', 'فضة', '2021-09-13 12:50:59', '2021-09-13 12:50:59', 'Product'),
(782, 8, 'sp', 'name', 'Plata Coho', '2021-09-13 12:50:59', '2021-09-13 12:50:59', 'Product'),
(783, 8, 'sp', 'description', '<p>Com&uacute;nmente llamado salm&oacute;n plateado, el coho tiene el dorso azul met&aacute;lico oscuro o verdoso con lados plateados y un vientre claro. Mientras est&aacute;n en el oc&eacute;ano, tienen peque&ntilde;as manchas negras en la espalda y en el l&oacute;bulo superior de la cola. La l&iacute;nea de las enc&iacute;as en la mand&iacute;bula inferior tiene un pigmento m&aacute;s claro que en el salm&oacute;n Chinook.</p>', '2021-09-13 12:50:59', '2021-09-13 12:50:59', 'Product'),
(784, 8, 'sp', 'meta_keyword', 'Plata Coho', '2021-09-13 12:50:59', '2021-09-13 12:50:59', 'Product'),
(785, 8, 'sp', 'colorname', 'Plata', '2021-09-13 12:50:59', '2021-09-13 12:50:59', 'Product'),
(786, 9, 'en', 'name', 'Atlantic Salmo Salar', '2021-09-13 13:04:06', '2021-09-13 13:04:06', 'Product'),
(787, 9, 'en', 'description', '<p>The Atlantic salmon (Salmo salar)&nbsp;inhabits rivers and streams that flow into the northern Atlantic Ocean in Europe&nbsp;and enter the sea on the east coast of North America. Salmon spend part of their life-cycle feeding in the ocean but return to the streams where they hatched to spawn.</p>', '2021-09-13 13:04:06', '2021-09-13 13:04:06', 'Product'),
(788, 9, 'en', 'meta_keyword', 'Atlantic Salmo Salar', '2021-09-13 13:04:06', '2021-09-13 13:04:06', 'Product'),
(789, 9, 'en', 'colorname', 'Silver', '2021-09-13 13:04:06', '2021-09-13 13:04:06', 'Product'),
(790, 9, 'ar', 'name', 'أتلانتيك سالمو سالار', '2021-09-13 13:04:06', '2021-09-13 13:04:06', 'Product'),
(791, 9, 'ar', 'description', '<p>يسكن سمك السلمون الأطلسي الأنهار والجداول التي تصب في شمال المحيط الأطلسي في أوروبا وتدخل البحر على الساحل الشرقي لأمريكا الشمالية. يقضي السلمون جزءًا من دورة حياته في التغذية في المحيط ولكنه يعود إلى الجداول حيث يفقس ليبيض.</p>', '2021-09-13 13:04:06', '2021-09-13 13:04:06', 'Product'),
(792, 9, 'ar', 'meta_keyword', 'أتلانتيك سالمو سالار', '2021-09-13 13:04:06', '2021-09-13 13:04:06', 'Product'),
(793, 9, 'ar', 'colorname', 'فضة', '2021-09-13 13:04:06', '2021-09-13 13:04:06', 'Product'),
(794, 9, 'sp', 'name', 'Salar de salmo atlántico', '2021-09-13 13:04:06', '2021-09-13 13:04:06', 'Product'),
(795, 9, 'sp', 'description', '<p>El salm&oacute;n del Atl&aacute;ntico (Salmo salar) habita en r&iacute;os y arroyos que desembocan en el norte del Oc&eacute;ano Atl&aacute;ntico en Europa y entran al mar en la costa este de Am&eacute;rica del Norte. Los salmones pasan parte de su ciclo de vida aliment&aacute;ndose en el oc&eacute;ano, pero regresan a los arroyos donde nacieron para desovar.</p>', '2021-09-13 13:04:06', '2021-09-13 13:04:06', 'Product'),
(796, 9, 'sp', 'meta_keyword', 'Salar de salmo atlántico', '2021-09-13 13:04:06', '2021-09-13 13:04:06', 'Product'),
(797, 9, 'sp', 'colorname', 'Plata', '2021-09-13 13:04:06', '2021-09-13 13:04:06', 'Product'),
(798, 10, 'en', 'name', 'Chicken Schnitzel', '2021-09-14 03:21:09', '2021-09-14 03:21:09', 'Product'),
(799, 10, 'en', 'description', '<p>A schnitzel is&nbsp;a thin slice of meat. The meat is usually thinned by pounding with a meat tenderizer. Most commonly, the meat is breaded before frying. Breaded schnitzel is popular in many countries and is made using veal, pork, chicken, mutton, beef, or turkey.</p>', '2021-09-14 03:21:09', '2021-09-14 03:21:09', 'Product'),
(800, 10, 'en', 'meta_keyword', 'Chicken Schnitzel', '2021-09-14 03:21:09', '2021-09-14 03:21:09', 'Product'),
(801, 10, 'en', 'colorname', 'Red', '2021-09-14 03:21:09', '2021-09-14 03:21:09', 'Product'),
(802, 10, 'ar', 'name', 'الدجاج شريحة', '2021-09-14 03:21:09', '2021-09-14 03:21:09', 'Product'),
(803, 10, 'ar', 'description', '<p>شنيتزل شريحة رقيقة من اللحم. عادة ما يتم تخفيف اللحم عن طريق السحق بمُطَرِّيات اللحم. الأكثر شيوعًا أن اللحم يخبز بالبقسماط قبل القلي. شنيتزل المخبوز شائع في العديد من البلدان ويتم تصنيعه باستخدام لحم العجل أو لحم الخنزير أو الدجاج أو لحم الضأن أو لحم البقر أو الديك الرومي.</p>', '2021-09-14 03:21:09', '2021-09-14 03:21:09', 'Product'),
(804, 10, 'ar', 'meta_keyword', 'الدجاج شريحة', '2021-09-14 03:21:09', '2021-09-14 03:21:09', 'Product'),
(805, 10, 'ar', 'colorname', 'أحمر', '2021-09-14 03:21:09', '2021-09-14 03:21:09', 'Product'),
(806, 10, 'sp', 'name', 'Schnitzel de pollo', '2021-09-14 03:21:09', '2021-09-14 03:21:09', 'Product'),
(807, 10, 'sp', 'description', '<p>Un escalope es una fina rebanada de carne. La carne generalmente se adelgaza machacando con un ablandador de carne. Por lo general, la carne se empaniza antes de fre&iacute;r. El escalope empanizado es popular en muchos pa&iacute;ses y se elabora con ternera, cerdo, pollo, cordero, ternera o pavo.</p>', '2021-09-14 03:21:09', '2021-09-14 03:21:09', 'Product'),
(808, 10, 'sp', 'meta_keyword', 'Schnitzel de pollo', '2021-09-14 03:21:09', '2021-09-14 03:21:09', 'Product'),
(809, 10, 'sp', 'colorname', 'Rojo', '2021-09-14 03:21:09', '2021-09-14 03:21:09', 'Product'),
(810, 11, 'en', 'name', 'Chicken Barbequed Skewers', '2021-09-14 03:46:58', '2021-09-14 03:46:58', 'Product'),
(811, 11, 'en', 'description', '<p>A skewer is a thin metal or wood stick used to hold pieces of food together. The word may sometimes be used as a metonym, to refer to the entire food item served on a skewer, as in &ldquo;chicken skewers&rdquo;. Skewers are used while&nbsp;grilling or roasting meats and fish, and in other culinary applications.</p>', '2021-09-14 03:46:58', '2021-09-14 03:46:58', 'Product'),
(812, 11, 'en', 'meta_keyword', 'Chicken Barbequed Skewers', '2021-09-14 03:46:58', '2021-09-14 03:46:58', 'Product'),
(813, 11, 'en', 'colorname', 'Red', '2021-09-14 03:46:58', '2021-09-14 03:46:58', 'Product'),
(814, 11, 'ar', 'name', 'أسياخ دجاج مشوية', '2021-09-14 03:46:58', '2021-09-14 03:46:58', 'Product'),
(815, 11, 'ar', 'description', '<p>السيخ عبارة عن عصا معدنية أو خشبية رفيعة تستخدم لتثبيت قطع الطعام معًا. قد تُستخدم الكلمة أحيانًا كمجاز ، للإشارة إلى صنف الطعام بأكمله الذي يتم تقديمه على سيخ ، كما هو الحال في &quot;أسياخ الدجاج&quot;. تُستخدم الأسياخ أثناء شوي اللحوم والأسماك أو تحميصها وفي تطبيقات الطهي الأخرى.</p>', '2021-09-14 03:46:58', '2021-09-14 03:46:58', 'Product'),
(816, 11, 'ar', 'meta_keyword', 'أسياخ دجاج مشوية', '2021-09-14 03:46:58', '2021-09-14 03:46:58', 'Product'),
(817, 11, 'ar', 'colorname', 'أحمر', '2021-09-14 03:46:58', '2021-09-14 03:46:58', 'Product'),
(818, 11, 'sp', 'name', 'Brochetas de pollo a la parrilla', '2021-09-14 03:46:58', '2021-09-14 03:46:58', 'Product'),
(819, 11, 'sp', 'description', '<p>Una brocheta es un palito delgado de metal o madera que se usa para unir trozos de comida. La palabra a veces se puede usar como metonimia, para referirse a todo el alimento que se sirve en una brocheta, como en &quot;brochetas de pollo&quot;. Las brochetas se utilizan para asar o asar carnes y pescados, y en otras aplicaciones culinarias.</p>', '2021-09-14 03:46:58', '2021-09-14 03:46:58', 'Product'),
(820, 11, 'sp', 'meta_keyword', 'Brochetas de pollo a la parrilla', '2021-09-14 03:46:58', '2021-09-14 03:46:58', 'Product'),
(821, 11, 'sp', 'colorname', 'Roja', '2021-09-14 03:46:58', '2021-09-14 03:46:58', 'Product'),
(822, 12, 'en', 'name', 'Fried Chicken Cutlets', '2021-09-14 04:03:20', '2021-09-14 04:03:20', 'Product'),
(823, 12, 'en', 'description', '<p>A cutlet is&nbsp;simply a thin piece of chicken breast. It&#39;s also a solution for easy weeknight cooking. ... Many recipes call for making cutlets or thin pieces of chicken breast by pounding them to an even thickness. You put the chicken breast between two sheets of plastic wrap and use a meat mallet to pound it thin.</p>', '2021-09-14 04:03:20', '2021-09-14 04:03:20', 'Product'),
(824, 12, 'en', 'meta_keyword', 'Fried Chicken Cutlets', '2021-09-14 04:03:20', '2021-09-14 04:03:20', 'Product'),
(825, 12, 'en', 'colorname', 'Red', '2021-09-14 04:03:20', '2021-09-14 04:03:20', 'Product'),
(826, 12, 'ar', 'name', 'شرحات دجاج مقلية', '2021-09-14 04:03:20', '2021-09-14 04:03:20', 'Product'),
(827, 12, 'ar', 'description', '<p>الكستليتة هي ببساطة قطعة رقيقة من صدور الدجاج. إنه أيضًا حل للطهي السهل في نهاية الأسبوع. ... تتطلب العديد من الوصفات عمل شرحات أو قطع رقيقة من صدور الدجاج بدقها حتى تصل إلى سمك متساوٍ. ضع صدور الدجاج بين طبقتين من الغلاف البلاستيكي واستخدم مطرقة لحم لدقه برفق.</p>', '2021-09-14 04:03:20', '2021-09-14 04:03:20', 'Product'),
(828, 12, 'ar', 'meta_keyword', 'شرحات دجاج مقلية', '2021-09-14 04:03:20', '2021-09-14 04:03:20', 'Product'),
(829, 12, 'ar', 'colorname', 'أحمر', '2021-09-14 04:03:20', '2021-09-14 04:03:20', 'Product'),
(830, 12, 'sp', 'name', 'Chuletas de pollo frito', '2021-09-14 04:03:20', '2021-09-14 04:03:20', 'Product'),
(831, 12, 'sp', 'description', '<p>Una chuleta es simplemente un trozo delgado de pechuga de pollo. Tambi&eacute;n es una soluci&oacute;n para cocinar f&aacute;cilmente entre semana. ... Muchas recetas requieren hacer chuletas o trozos finos de pechuga de pollo machac&aacute;ndolos hasta que tengan un grosor uniforme. Coloca la pechuga de pollo entre dos hojas de pl&aacute;stico y usa un mazo de carne para machacarla.</p>', '2021-09-14 04:03:20', '2021-09-14 04:03:20', 'Product'),
(832, 12, 'sp', 'meta_keyword', 'Chuletas de pollo frito', '2021-09-14 04:03:20', '2021-09-14 04:03:20', 'Product'),
(833, 12, 'sp', 'colorname', 'Roja', '2021-09-14 04:03:20', '2021-09-14 04:03:20', 'Product'),
(834, 13, 'en', 'name', 'Chicken Katsu', '2021-09-14 04:22:18', '2021-09-14 04:22:18', 'Product'),
(835, 13, 'en', 'description', '<p>Chicken katsu is&nbsp;boneless panko-crusted chicken that has been deep fried to perfection. Many people prefer chicken katsu made with tender chicken breast as a healthier alternative to tonkatsu, but butterflied chicken thigh is also used for a juicier version.</p>', '2021-09-14 04:22:18', '2021-09-14 04:22:18', 'Product'),
(836, 13, 'en', 'meta_keyword', 'Chicken Katsu', '2021-09-14 04:22:18', '2021-09-14 04:22:18', 'Product'),
