(838, 13, 'ar', 'name', 'كاتسو دجاج', '2021-09-14 04:22:18', '2021-09-14 04:22:18', 'Product'),
(839, 13, 'ar', 'description', '<p>كاتسو الدجاج عبارة عن دجاج مقلي بالبانكو منزوع العظم ومقلي إلى درجة الكمال. كثير من الناس يفضلون كاتسو الدجاج المصنوع من صدور الدجاج الطرية كبديل صحي للتونكاتسو ، لكن فخذ الدجاج المغطى بالزبدة يستخدم أيضًا لنسخة أكثر عصارة.</p>', '2021-09-14 04:22:18', '2021-09-14 04:22:18', 'Product'),
