(855, 14, 'sp', 'description', '<p>La base de la pizza generalmente se unta con salsa de tomate y luego se cubre con mozzarella y salchichas de Viena cortadas en rodajas. Procedente del lugar de nacimiento real de la pizza, la ciudad de N&aacute;poles, la pizza vienesa es especialmente querida por los ni&ntilde;os, que son, como la mayor&iacute;a de los italianos estar&iacute;an de acuerdo, sus principales consumidores.</p>', '2021-09-14 04:42:44', '2021-09-14 04:42:44', 'Product'),
