(862, 15, 'ar', 'name', 'بيتزا كاريتيرا', '2021-09-14 04:57:36', '2021-09-14 04:57:36', 'Product'),
(863, 15, 'ar', 'description', '<p>بيتزا كاريتيرا هي مجموعة متنوعة من البيتزا الإيطالية المغطاة تقليديا بصلصة الطماطم ، رابيني ، بيبرونسيني ، ساليسكا ، وجبن بروفولون مدخن. تُعرف عمومًا باسم بيتزا الساليسيا إي فرياريلي ، أو النقانق وبيتزا رابيني ، وهي واحدة من أكثر أنواع البيتزا النابولية المحبوبة.</p>', '2021-09-14 04:57:36', '2021-09-14 04:57:36', 'Product'),
