(878, 16, 'sp', 'name', 'Pepperoni', '2021-09-14 05:32:37', '2021-09-14 05:32:37', 'Product'),
(879, 16, 'sp', 'description', '<p>El pepperoni es una variedad estadounidense de salami, elaborado con carne de cerdo curada y ternera sazonada con piment&oacute;n u otro aj&iacute;. El pepperoni es caracter&iacute;sticamente suave, ligeramente ahumado y de color rojo brillante. El pepperoni en rodajas finas es un aderezo de pizza popular en las pizzer&iacute;as estadounidenses.</p>', '2021-09-14 05:32:37', '2021-09-14 05:32:37', 'Product'),
