(894, 18, 'en', 'name', 'Ghee', '2021-09-14 06:14:24', '2021-09-14 06:14:24', 'Product'),
(895, 18, 'en', 'description', '<p>Ghee is a form of highly-clarified butter that is traditionally used in Asian cooking. Like butter, ghee is typically made from cow&#39;s milk. ... The butter separates into liquid fats and milk solids. Once separated, the milk solids are removed, which means that ghee has less lactose than butter.</p>', '2021-09-14 06:14:24', '2021-09-14 06:14:24', 'Product'),
(896, 18, 'en', 'meta_keyword', 'Ghee', '2021-09-14 06:14:24', '2021-09-14 06:14:24', 'Product'),
(897, 18, 'en', 'colorname', 'Yellow', '2021-09-14 06:14:24', '2021-09-14 06:14:24', 'Product'),
(898, 18, 'ar', 'name', 'سمن', '2021-09-14 06:14:24', '2021-09-14 06:14:24', 'Product'),
(899, 18, 'ar', 'description', '<p>السمن هو شكل من أشكال الزبدة عالية الوضوح التي تستخدم تقليديا في الطبخ الآسيوي. مثل الزبدة ، يصنع السمن عادة من حليب البقر. ... تنفصل الزبدة إلى دهون سائلة وجوامد حليب. بمجرد فصله ، تتم إزالة مواد الحليب الصلبة ، مما يعني أن السمن يحتوي على نسبة أقل من اللاكتوز من الزبدة.</p>', '2021-09-14 06:14:24', '2021-09-14 06:14:24', 'Product'),
(900, 18, 'ar', 'meta_keyword', 'سمن', '2021-09-14 06:14:24', '2021-09-14 06:14:24', 'Product'),
(901, 18, 'ar', 'colorname', 'أصفر', '2021-09-14 06:14:24', '2021-09-14 06:14:24', 'Product'),
(902, 18, 'sp', 'name', 'Ghee', '2021-09-14 06:14:24', '2021-09-14 06:14:24', 'Product'),
(903, 18, 'sp', 'description', '<p>Ghee es una forma de mantequilla altamente clarificada que se usa tradicionalmente en la cocina asi&aacute;tica. Al igual que la mantequilla, el ghee se elabora t&iacute;picamente con leche de vaca. ... La mantequilla se separa en grasas l&iacute;quidas y s&oacute;lidos l&aacute;cteos. Una vez separados, los s&oacute;lidos de la leche se eliminan, lo que significa que el ghee tiene menos lactosa que la mantequilla.</p>', '2021-09-14 06:14:24', '2021-09-14 06:14:24', 'Product'),
(904, 18, 'sp', 'meta_keyword', 'Ghee', '2021-09-14 06:14:24', '2021-09-14 06:14:24', 'Product'),
