(906, 19, 'en', 'name', 'Unsalted Butter', '2021-09-14 06:34:28', '2021-09-14 06:34:28', 'Product'),
(907, 19, 'en', 'description', '<p>A type of butter that does not contain any salt. Unsalted butter is often prefered for use in cooking and baking because it does not contain any salt, which may tend to alter the flavor of the food when added to some recipes.</p>', '2021-09-14 06:34:28', '2021-09-14 06:34:28', 'Product'),
