(910, 19, 'ar', 'name', 'زبدة غير مملحة', '2021-09-14 06:34:28', '2021-09-14 06:34:28', 'Product'),
(911, 19, 'ar', 'description', '<p>نوع من الزبدة لا يحتوي على أي ملح. غالبًا ما تُفضل الزبدة غير المملحة للاستخدام في الطهي والخبز لأنها لا تحتوي على أي ملح ، مما قد يغير نكهة الطعام عند إضافته إلى بعض الوصفات.</p>', '2021-09-14 06:34:28', '2021-09-14 06:34:28', 'Product'),
