(914, 19, 'sp', 'name', 'Mantequilla sin sal', '2021-09-14 06:34:28', '2021-09-14 06:34:28', 'Product'),
(915, 19, 'sp', 'description', '<p>Un tipo de mantequilla que no contiene sal. La mantequilla sin sal a menudo se prefiere para cocinar y hornear porque no contiene sal, lo que puede tender a alterar el sabor de los alimentos cuando se agrega a algunas recetas.</p>', '2021-09-14 06:34:28', '2021-09-14 06:34:28', 'Product'),
