(918, 20, 'en', 'name', 'Cultured Butter', '2021-09-14 06:51:18', '2021-09-14 06:51:18', 'Product'),
(919, 20, 'en', 'description', '<p>Cultured butter is made from cultured cream. In other words,&nbsp;cream that contains live bacterial cultures and has fermented for a period of time. Similar to yogurt, cultured butter has a slightly tangy flavor that sets it apart from regular butter. It has a unique flavor that enhances just about everything.</p>', '2021-09-14 06:51:18', '2021-09-14 06:51:18', 'Product'),
