(942, 22, 'en', 'name', 'Kale', '2021-09-14 07:21:44', '2021-09-14 07:21:44', 'Product'),
(943, 22, 'en', 'description', '<p>Kale is&nbsp;a non-heading, leafy form of wild cabbage&nbsp;that comes in a range of shapes, sizes, and colors, such as blue-green, yellow-green, white, red, or purple. ... The standard Kale we usually find in the grocery store is pale to deep green with large, ruffle-edged leaves and long stems.</p>', '2021-09-14 07:21:44', '2021-09-14 07:21:44', 'Product'),
(944, 22, 'en', 'meta_keyword', 'Kale', '2021-09-14 07:21:44', '2021-09-14 07:21:44', 'Product'),
