(954, 23, 'en', 'name', 'Microgreens', '2021-09-14 07:37:14', '2021-09-14 07:37:14', 'Product'),
(955, 23, 'en', 'description', '<p>Microgreens are&nbsp;young vegetable greens&nbsp;that are approximately 1&ndash;3 inches (2.5&ndash;7.5 cm) tall. They have an aromatic flavor and concentrated nutrient content and come in a variety of colors and textures (1). Microgreens are considered baby plants, falling somewhere between a sprout and baby green.</p>', '2021-09-14 07:37:14', '2021-09-14 07:37:14', 'Product'),
(956, 23, 'en', 'meta_keyword', 'Microgreens', '2021-09-14 07:37:14', '2021-09-14 07:37:14', 'Product'),
(957, 23, 'en', 'colorname', 'Green', '2021-09-14 07:37:14', '2021-09-14 07:37:14', 'Product'),
(958, 23, 'ar', 'name', 'مايكروغرينز', '2021-09-14 07:37:14', '2021-09-14 07:37:14', 'Product'),
(959, 23, 'ar', 'description', '<p>الخضر الصغيرة هي خضروات شابة يبلغ طولها حوالي 1 إلى 3 بوصات (2.5-7.5 سم). لها نكهة عطرية ومحتوى مغذي مركّز وتأتي في مجموعة متنوعة من الألوان والقوام (1). تعتبر الخضر الصغيرة نباتات صغيرة تقع في مكان ما بين البرعم والأخضر الصغير.</p>', '2021-09-14 07:37:14', '2021-09-14 07:37:14', 'Product'),
(960, 23, 'ar', 'meta_keyword', 'مايكروغرينز', '2021-09-14 07:37:14', '2021-09-14 07:37:14', 'Product'),
(961, 23, 'ar', 'colorname', 'لون أخضر', '2021-09-14 07:37:14', '2021-09-14 07:37:14', 'Product'),
(962, 23, 'sp', 'name', 'Microgreens', '2021-09-14 07:37:14', '2021-09-14 07:37:14', 'Product'),
(963, 23, 'sp', 'description', '<p>Los microvegetales son verduras j&oacute;venes de aproximadamente 1 a 3 pulgadas (2,5 a 7,5 cm) de altura. Tienen un sabor arom&aacute;tico y un contenido de nutrientes concentrado y vienen en una variedad de colores y texturas (1). Los microgreens se consideran plantas beb&eacute;s, que se encuentran en alg&uacute;n lugar entre un brote y un verde beb&eacute;.</p>', '2021-09-14 07:37:14', '2021-09-14 07:37:14', 'Product'),
(964, 23, 'sp', 'meta_keyword', 'Microgreens', '2021-09-14 07:37:14', '2021-09-14 07:37:14', 'Product'),
