(1042, 30, 'ar', 'name', 'كب كيك بطعم الفانيلا', '2021-09-14 11:15:17', '2021-09-14 11:15:17', 'Product'),
(1043, 30, 'ar', 'description', '<p>يحتوي الكب كيك على ملمس أكثر نعومة ويسهل قضمه. فهي ليست مقرمشة أو كثيفة مثل الكعك. وتميل إلى عدم وجود الكثير من الحشوات بالداخل. المافن لها قوام أصعب قليلاً من الكب كيك.</p>', '2021-09-14 11:15:17', '2021-09-14 11:15:17', 'Product'),
