(1071, 32, 'sp', 'description', '<p>Entonces, &iquest;a qu&eacute; saben los macarons? Los macarons vienen en muchos sabores diferentes, que por supuesto afectan su sabor, pero los macarons deben tener una dulzura b&aacute;sica que no sea demasiado abrumadora y un ligero sabor a nuez de la harina de almendras. Deben estar ligeramente crujientes por fuera y un poco suaves y masticables por dentro.</p>', '2021-09-14 12:01:09', '2021-09-14 12:01:09', 'Product'),
