(1075, 33, 'en', 'description', '<p>Biscotti &nbsp;known also as cantucci are Italian almond biscuits that originated in the Tuscan city of Prato. They are twice-baked, oblong-shaped, dry, crunchy, and may be dipped in a drink, traditionally Vin Santo.</p>', '2021-09-14 12:32:48', '2021-09-14 12:32:48', 'Product'),
