(1083, 33, 'sp', 'description', '<p>Los biscotti tambi&eacute;n conocidos como cantucci son galletas de almendras italianas que se originaron en la ciudad toscana de Prato. Se hornean dos veces, son de forma oblonga, secas, crujientes y se pueden sumergir en una bebida, tradicionalmente Vin Santo.</p>', '2021-09-14 12:32:48', '2021-09-14 12:32:48', 'Product'),
