(1110, 36, 'en', 'name', 'Unsalted Butter', '2021-09-14 13:22:25', '2021-09-14 13:22:25', 'Product'),
(1111, 36, 'en', 'description', '<p>A type of butter that does not contain any salt. Unsalted butter is often prefered for use in cooking and baking because it does not contain any salt, which may tend to alter the flavor of the food when added to some recipes.</p>', '2021-09-14 13:22:25', '2021-09-14 13:22:25', 'Product'),
