(1114, 36, 'ar', 'name', 'زبدة غير مملحة', '2021-09-14 13:22:25', '2021-09-14 13:22:25', 'Product'),
(1115, 36, 'ar', 'description', '<p>نوع من الزبدة لا يحتوي على أي ملح. غالبًا ما تُفضل الزبدة غير المملحة للاستخدام في الطهي والخبز لأنها لا تحتوي على أي ملح ، مما قد يغير نكهة الطعام عند إضافته إلى بعض الوصفات.</p>', '2021-09-14 13:22:25', '2021-09-14 13:22:25', 'Product'),
