(1151, 39, 'ar', 'description', '<p>الخضر الصغيرة هي خضروات شابة يبلغ طولها حوالي 1 إلى 3 بوصات (2.5-7.5 سم). لها نكهة عطرية ومحتوى مغذي مركّز وتأتي في مجموعة متنوعة من الألوان والقوام (1). تعتبر الخضر الصغيرة نباتات صغيرة تقع في مكان ما بين البرعم والأخضر الصغير.</p>', '2021-09-15 03:56:38', '2021-09-15 03:56:38', 'Product'),
