(1163, 40, 'ar', 'description', '<p>ميزونا هي خضار ذات أوراق خضراء موطنها شرق آسيا (1). يشار إليها أيضًا باسم الخردل الياباني أو خردل العنكبوت أو قونية ا أوراق خضراء داكنة مسننة ذات سيقان رفيعة ونكهة فلفل مرّة قليلاً.</p>', '2021-09-15 04:07:53', '2021-09-15 04:07:53', 'Product'),
