(1174, 41, 'ar', 'name', 'شارد سويسري', '2021-09-15 04:14:37', '2021-09-15 04:14:37', 'Product'),
(1175, 41, 'ar', 'description', '<p>يحتوي السلق السويسري على أوراق عريضة وساق هش وهش. تتراوح السيقان من الأبيض إلى الوردي الحار أو الأحمر ، وغالبًا ما يُطلق عليه اسم &quot;شارد قوس قزح&quot; ، مع تغميق الأوراق باتجاه قمم الخضروات. الأوراق والساق كلاهما صالح للأكل.</p>', '2021-09-15 04:14:37', '2021-09-15 04:14:37', 'Product'),
