(1179, 41, 'sp', 'description', '<p>La acelga tiene hojas anchas y un tallo crujiente y ronco. El tallo var&iacute;a de blanco a rosa fuerte o rojo, a menudo llamado &quot;Acelga arco&iacute;ris&quot;, con las hojas oscureci&eacute;ndose hacia la parte superior de las verduras. Las hojas y el tallo son comestibles.</p>', '2021-09-15 04:14:37', '2021-09-15 04:14:37', 'Product'),
