(1186, 42, 'ar', 'name', 'الشمندر', '2021-09-15 04:21:00', '2021-09-15 04:21:00', 'Product'),
(1187, 42, 'ar', 'description', '<p>الشمندر (Beta vulgaris) هو خضروات جذرية تُعرف أيضًا باسم البنجر الأحمر أو بنجر المائدة أو بنجر الحديقة أو البنجر فقط. معبأ بالعناصر الغذائية الأساسية ، يعتبر الشمندر مصدرًا رائعًا للألياف ، وحمض الفوليك (فيتامين ب 9) ، والمنغنيز ، والبوتاسيوم ، والحديد ، وفيتامين سي ...</p>', '2021-09-15 04:21:00', '2021-09-15 04:21:00', 'Product'),
