(1190, 42, 'sp', 'name', 'Remolacha', '2021-09-15 04:21:00', '2021-09-15 04:21:00', 'Product'),
(1191, 42, 'sp', 'description', '<p>La remolacha (Beta vulgaris) es una verdura de ra&iacute;z tambi&eacute;n conocida como remolacha roja, remolacha de mesa, remolacha de jard&iacute;n o simplemente remolacha. Repletas de nutrientes esenciales, las remolachas son una gran fuente de fibra, &aacute;cido f&oacute;lico (vitamina B9), manganeso, potasio, hierro y vitamina C. ... Las remolachas son deliciosas crudas pero con mayor frecuencia cocidas o en escabeche</p>', '2021-09-15 04:21:00', '2021-09-15 04:21:00', 'Product'),
