(1223, 45, 'ar', 'description', '<p>فطر غني بالنكهة ولحم ، له غطاء بني غامق كبير ومسطّح يصل قطره إلى &nbsp;بوصات عندما ينضج. يُعرف هذا الفطر أيضًا باسمه العلمي&nbsp; ، وهو لذيذ عند شويه أو سلقه أو سوتيه ، مما يوفر نكهة مدخنة إلى حد ما أو نكهة ترابية.</p>', '2021-09-15 04:46:45', '2021-09-15 04:46:45', 'Product'),
