(1227, 45, 'sp', 'description', '<p>Un hongo de sabor rico y textura carnosa, que tiene una tapa grande, plana y de color marr&oacute;n oscuro que crece hasta 5 pulgadas de di&aacute;metro cuando est&aacute; maduro. Tambi&eacute;n conocido por su nombre cient&iacute;fico, agaricus bisporus, este hongo es delicioso cuando se asa a la parrilla, a la parrilla o salteado, proporcionando un sabor algo ahumado o terroso.</p>', '2021-09-15 04:46:45', '2021-09-15 04:46:45', 'Product'),
