(1231, 46, 'en', 'description', '<p>Cantharellus cinnabarinus Greek word&nbsp;meaning cup/ tankard or drinking vessel&nbsp;(or Cinnabar Red Chanterelle- ) is a fungus native to eastern North America. It is a member of the genus Cantharellus along with other chanterelles. It is named after its red color, which is imparted by the carotenoid canthaxanthin.</p>', '2021-09-15 05:02:20', '2021-09-15 05:02:20', 'Product'),
