(1235, 46, 'ar', 'description', '<p>الكلمة اليونانية التي تعني كأس / خزان أو وعاء شرب هي فطر موطنه شرق أمريكا الشمالية. إنه عضو في الجنس مع تشانريل أخرى. سمي على اسم لونه الأحمر ، الذي يُضفي عليه الكانتازانثين الكاروتين.</p>', '2021-09-15 05:02:20', '2021-09-15 05:02:20', 'Product'),
