(1247, 47, 'ar', 'description', '<p>الكانثاريلس له حواف متداخلة متشعبة ، غطاء يبلغ قطره من 2.5 إلى 11 سم ويمكن أن يكون في العينات القديمة. اللحم صلب وأبيض إلى أصفر باهت من الداخل ويمكن أن تشم رائحة الفواكه ، وغالبًا ما توصف برائحة المشمش. تقترب قاعدة الفطر من الغطاء.</p>', '2021-09-15 05:17:54', '2021-09-15 05:17:54', 'Product'),
(1248, 47, 'ar', 'meta_keyword', 'الكانثاريلوس', '2021-09-15 05:17:54', '2021-09-15 05:17:54', 'Product'),
