(1258, 48, 'ar', 'name', 'فطر المحار', '2021-09-15 05:28:19', '2021-09-15 05:28:19', 'Product'),
(1259, 48, 'ar', 'description', '<p>يتكون فطر المحار من ثلاثة أجزاء متميزة - قشرة سمين أو غطاء على شكل ملعقة (صديد) ، ساق جانبي أو مركزي قصير أو طويل يسمى السيقان والحواف الطويلة والأخاديد الموجودة أسفل الصليور تسمى الخياشيم أو الصفائح. تمتد الخياشيم من حافة الغطاء نزولاً إلى الساق وتحمل الجراثيم.</p>', '2021-09-15 05:28:19', '2021-09-15 05:28:19', 'Product'),
(1260, 48, 'ar', 'meta_keyword', 'فطر المحار', '2021-09-15 05:28:19', '2021-09-15 05:28:19', 'Product'),
