(1262, 48, 'sp', 'name', 'Setas de cardo', '2021-09-15 05:28:19', '2021-09-15 05:28:19', 'Product'),
(1263, 48, 'sp', 'description', '<p>Los hongos ostra tienen tres partes distintas: un caparaz&oacute;n carnoso o un sombrero en forma de esp&aacute;tula (pileus), un tallo central o lateral corto o largo llamado est&iacute;pite y crestas y surcos largos debajo del pileus llamados branquias o laminillas. Las branquias se extienden desde el borde del sombrero hasta el tallo y contienen las esporas.</p>', '2021-09-15 05:28:19', '2021-09-15 05:28:19', 'Product'),
(1264, 48, 'sp', 'meta_keyword', 'Setas de cardo', '2021-09-15 05:28:19', '2021-09-15 05:28:19', 'Product'),
