INSERT INTO `reviews` (`id`, `product_id`, `res_id`, `review`, `user_id`, `ratting`, `is_approved`, `is_deleted`, `created_at`, `updated_at`) VALUES
(1, 0, 194, 'Amaazing food! The whole experience from start to finish is great waitress is always so friendly and kind. The food can’t get better and the prices are fair for the portion size. Always a great spot to get great food.', 213, '4', '1', '0', '2022-12-26 11:07:34', '2022-12-26 11:07:34'),
(2, 1, 195, 'The food at Hatsuhana Sushi Restaurant is exceptional! Very tasty and well prepared and you can chose among many menu options. I love the service at the place and the chef is so friendly with the guests and always takes care to offer the best quality! I highly recommend this place.', 223, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(3, 1, 194, 'Delicious high quality plates, selection of wines and great service.\r\nWe tried all their entrees, one of their desserts, and everything was de-li-cious. Highly recommended.', 219, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(4, 1, 195, 'I really liked the quality , the products were fresh.', 219, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(5, 2, 196, 'The quality of the product was very good.', 213, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(6, 2, 201, ' It’s a great experience. The ambiance is very welcoming and charming. Amazing wines, food and service. Staff are extremely knowledgeable and make great recommendations.', 224, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(7, 2, 201, 'Excellent food. Menu is extensive and seasonal to a particularly high standard. Definitely fine dining. It can be expensive but worth it and they do different deals on different nights so it’s worth checking them out before you book. Highly recommended.', 223, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(8, 2, 194, 'Searching for places to eat in the local area and this place popped up. I don’t normally leave reviews but I feel compelled as the food was absolutely exquisite. The Club A Steakhouse may be the best dessert I’ve ever had! Just annoyed I had to share it.', 220, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(9, 3, 201, ' This place is great! Atmosphere is chill and cool but the staff is also really friendly. They know what they’re doing and what they’re talking about, and you can tell making the customers happy is their main priority. Food is pretty good, some italian classics and some twists, and for their prices it’s 100% worth it.', 213, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(10, 3, 195, 'Would surely recommend to others, quality was amazing.', 220, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(11, 3, 194, 'Absolutely amazing! The place is beautiful and staff are super friendly and the food is delicious. I love that you get a lot of food as well for the price. It’s definitely not like other expensive restaurants and you only get a small amount of food. I am definitely going back.', 222, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(12, 3, 196, 'We are so fortunate to have this place just a few minutes drive away from home. Food is stunning, both the tapas and downstairs restaurant. Cocktails wow, wine great and lovely selection of beers. Love this place and will continue to visit.', 224, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(15, 4, 197, 'Delicious food, waiters are very attentive, and super nice atmosphere. Plus it’s all at an affordable price.\r\nCan totally recommend it and will definitely come back again.', 219, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(16, 4, 198, ' Loved this place. The atmosphere, food and most of the drinks were great. The bartenders knew their mixology and it showed in the drinks. Great place to hangout, chill or go out on a date.', 224, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(17, 5, 199, ' Stopped in for dinner and had a great meal. Staff was helpful and knowledgeable about the menu offering great recommendations. The atmosphere is cozy and pleasant. The dishes were delicious as were the wine and cocktail recommendations.', 219, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(18, 5, 200, 'This cozy restaurant has left the best impressions! Hospitable hosts, delicious dishes, beautiful presentation, wide wine list and wonderful dessert. I recommend to everyone! I would like to come back here again and again.', 223, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(19, 5, 198, 'Excellent, unassuming and wonderful find. Great variety and fine value tasting menu. Exciting food with high quality presentation, service and inventiveness. A highlight of (CN). Book to avoid disappointment it’s really worth it.\r\n', 213, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(20, 5, 194, 'Firstly I\'m happy for getting this Product. One of the best Product i bought in this year. It\'s a very good product', 223, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(21, 6, 199, 'Outstanding meal here. I had the Filet Mignon and my colleague had the Crabcake.\r\nThe staff does an amazing job of describing anything on the menu and the ambiance is very cool. Can’t wait to come back!', 223, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(23, 6, 200, 'First time in Piccola Cucina Estiatorio and YOU have to go! It’s the cutest little spot with amazing food. The Piccola Cucina Estiatorio is to die for. IT WAS FIRE!! The service we received was so amazing and we will definitely be back again. They made us feel welcomed and gave us an amazing experience.', 224, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(25, 7, 199, 'This place is elegant with an awesome vibe. I went for breakfast and the food was amazing. The service was speedy and friendly. Their Thick Cut Bacon are absolutely incredible! This lone visit has made this one of my favorite spots within me.', 213, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
