(49, 13, 203, 'This place is great! Atmosphere is chill and cool but the staff is also really friendly. They know what they’re doing and what they’re talking about, and you can tell making the customers happy is their main priority. Food is pretty good, some italian classics and some twists, and for their prices it’s 100% worth it.', 223, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(50, 13, 255, ' This cozy restaurant has left the best impressions! Hospitable hosts, delicious dishes, beautiful presentation, wide wine list and wonderful dessert. I recommend to everyone! I would like to come back here again and again.', 224, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
